import request from '@/utils/request'

export function createCase(data) {
  return request({
    url: process.env.VUE_APP_BACKEND_API + '/addCase',
    method: 'post',
    data
  })
}

export function fetchCase(data) {
  return request({
    url: process.env.VUE_APP_BACKEND_API + '/queryCase',
    method: 'post',
    data
  })
}
